import styled from 'styled-components';

export const SignUpContainer = styled.div`
	display: flex;
	flex-direction: column;
	width: 480px;
	margin-top: -70px;
	@media screen and (max-width: 800px) {
		width: 90vw;
		margin-top: 10px;
	}
`;
export const Title = styled.span`
	margin: 10px 0;
`;
